INSERT INTO movie VALUES
(1, '6 Underground', 'Netflixov akcijski triler od redatelja Michael Baya (Armageddon, Transformers) s Ryan Reynoldsom u glavnoj ulozi. Šest radikalnih tragača za uzbuđenjem sa svih strana svijeta koji, nakon lažiranja vlastite smrti, formiraju tajni tim za borbu protiv kriminala. Svaki od njih najbolji je u svom poslu te su izabrani ne samo zbog svoje vještine, već i zbog jedinstvene želje za brisanjem prošlosti da bi promijenili budućnost. Tim okuplja zagonetni vođa (Ryan Reynolds), čija je jedina životna misija osigurati da se, on i njegovi suradnici, nikada neće sjetiti njihovih akcija…', 3, '2019-12-10 00:00:00', './Content/images/6underground.jpg'),
(2, 'Terminator: DarkFate', 'Više od tri desetljeća prošlo je od prikazivanja prvog Terminatora. U novom nastavku ovog filma gledamo legende iz prvog filma. Serijal se vraća korijenima, ali ima i suvremenu senzibilnost temeljenu na kolektivnoj anksioznosti oko umjetne inteligencije. Prva dva filma o Terminatoru su se bavila tjeskobom o strojevima iz budućnosti i njihovim prihvaćanjem. Ideja ovog filma je predstaviti priču koja ima smisla u sadašnjosti, a puno toga čini se kao najava onog što nas čega u stvarnom životu…', 3, '2019-10-23 00:00:00', './Content/images/TerminatorDarkFate.jpg'),
(3, 'Onward', 'Smješten u predgrađu izmišljenog svijeta, Disneyev i Pixarov donose novu priču o dvojicic tinejdžera vilenjaka koji se upuštaju u uzbudljivu misiju otkrivanja postoji li u svijetu još uvijek bar malo čarolije. Originalni film studija Pixar režirao je Dan Scanlon, a producirala Kori Rae – ovo je ujedno i duo koji nam je donio hit „Čudovišta iz ormara“.', 4, '2020-02-21 00:00:00', './Content/images/Onward.jpg'),
(4, 'Wheely', 'U imaginarnom svijetu u kojem su građani automobili, Brzi Brzić je mali žuti taksi koji sanja da postane glavni u svom rodnom gradu, Gasketu. Kada djevojka u koju je zaljubljen biva oteta, on se mora suočiti sa svojim neprijateljima u teškoj brdskoj trci. Borit će se protiv luksuznih automobila, terenaca i ogromnog kamiona sa 18 kotača, koji je vođa ove zle ekipe.', 2, '2018-08-16 00:00:00', './Content/images/Wheely.jpg'),
(5, 'Apollo 13', 'Temeljen na neuspjeloj trećoj misiji slijetanja na Mjesec, ovaj film priča priču o letjelici Apollo 13 i njenoj posadi, kao i njihovim obiteljima, nakon gotovo fatalne nesreće koja je paralizirala cijelu letjelicu. Misija koja nije bila prikazivana na televiziji jer su lansiranja postala svakodnevnica za publiku odjednom je dobila ogromnu medijsku pozornost nakon nesreće, a herojstvo i kreativnost znanstvenika koju su nadzirali misiju uistinu pokazuje koliko toga ljudi mogu napraviti.', 5, '1995-11-30 00:00:00', './Content/images/Apollo13.jpg'),
(6, 'X-Men: Days of Future Past', '2023. g. cijela ljudska vrsta je na rubu uništenja. Sentineli, ogirinalno napravljeni da ubiju mutante sada love cijelo čovječanstvo. Preostali preživjeli ne mogu više mirno stajati i gledati uništavanje koje izvršavaju Sentineli. Kako bi spasili budućnost, Wolverine biva poslan natrag u prošlost, u godinu 1973. kako bi zaustavio rat prije nego li uopće i započne.', 5, '2014-05-22 00:00:00', './Content/images/XMen.png'),
(7, 'The Beatles: Eight Days a Week', 'Tokom 1960-ih, Beatlesi su eksplodirali na javnoj sceni, naizgled došavši niotkuda, dok su se zapravo njihove početne godine i konstantni nastupi u lokalnoj sceni napokon isplatili, a oni postali mega-popularni. Uz nove intervjue preostalih živućih članova benda, ovaj film sadrži i arhivske snimke njihovih koncertnih godina između 1963. i 1966. tokom kojih su postali svjetski fenomeni i likovi koji će zauvijek promijeniti lice svijeta. Osim toga, ovaj film prikazuje i kako se ova famozna četvorka malo po malo promjenila i kako je uzbuđenje nazvano Beatlemanijom ubrzo njihove živote pretvorilo u nešto sasvim nepodnošljivo – mjesto iz kojeg su jednostavno morali pronaći bijeg.', 4, '2016-09-15 00:00:00', './Content/images/TheBeatles.jpg'),
(8, 'Zeitgeist', 'Zeitgeist je dokumentarni film koji svoje informacije vuče iz mnogih izvora, te ih spaja u jednu cjelinu koja pokazuje da je veoma jednostvano manipulirati ljudima, pogotovo od strane velikih korporacija, vlada i ekonomskih sila. Film je podijeljen na tri dijela. Prvi dio govori o religiji i uspoređuje drevna poganska vjerovanja sa modernom religijom. Drugi dio bavi se najpoznatijim terorističkim činom – padom World Trade Centera, te mnogim pitanjima koja su proizašla iz tog uistinu sumnjivog događaja. Posljednji dio bavi se Federalnom bankom i njenom povijesti, te načinom na koji ona kontrolira današnje društvo. Film sadrži mnogo isječaka iz vijesti i tragičnih povijesnih događaja, te audio snimke ljudi koji vjeruju da je čovječanstvo manipulirano, te da ni sami nisu svjesni koliku slobodu zapravo imaju.', 5, '2007-06-18 00:00:00', './Content/images/Zeitgeist.jpg'),
(9, 'Mulan', 'Nakon što kineski car izda dekret po kojem jedan muškarac u svakoj obitelji mora služiti carskoj vojsci kako bi obranili zemlju od sjevernih napadača, Hua Mulan, najstarija kćerka časnog ratnika, istupa umjesto svog bolesnog oca. Maskirajući se kao muškarac, Hua Jun prolazi iskušenja na svakom koraku svog puta te mora naučiti iskoristiti svoju unutarnju snagu i prihvatiti svoj istinski potencijal. Mulan će se transformirati u časnu ratnicu i steći poštovanje zahvalne nacije, ali i ponosnog oca…', 2, '2020-03-09 00:00:00', './Content/images/Mulan.jpg'),
(10, 'Beautiful Creatures', 'Ethan žudi za bijegom iz svog malenog gradića na jugu. On upoznaje novu misterioznu djevojku Lenu. Zajedno, oni otkrivaju mračne strane svojih obitelji, njihovu povijest i povijest svog grada.', 4, '2013-02-14 00:00:00', './Content/images/BeautifulCreatures.jpg\r\n'),
(11, 'Star Wars: Episode IV - A New Hope', 'Nekoć davno, u veoma dalekoj galaksiji… Princeza Leia biva oteta od strane zlih imperijskih sila koje žele ugasiti pobunjenički pokret protiv Galaktičkog carstva. Farmer Luke Skywalker i kapetan Han Solo moraju se udružiti, zajedno sa simpatičnim robotima R2-D2 i C3PO, kako bi spasili lijepu princezu i vratili pravdu u galaksiju.', 5, '1977-05-25 00:00:00', './Content/images/StarWars.jpg'),
(12, '28 Days Later...', 'Kada mlada djeca u malenom gradiću Derryju u Maineu počnu bivati ubijena bez ikakvog objašnjenja, skupina od sedmero klinaca udruži se kako bi pronašli krivca, no ubrzo saznaju kako nije riječ o običnom čovjeku. Ubojica je nitko drugi nego zli klaun Pennywise koji je zapravo čudovište koje može poprimiti oblik onoga čega se njegov plijen najviše boji. Sada će naša skupina, koja se nazvala “Losers Club”, morati naučiti kako se boriti protiv svojih najvećih strahova i riješiti se čudovišta jednom zauvijek.', 3, '2002-11-01 00:00:00', './Content/images/28DaysLater.jpg'),
(13, 'It', 'Kada mlada djeca u malenom gradiÄ‡u Derryju u Maineu poÄŤnu bivati ubijena bez ikakvog objaĹˇnjenja, skupina od sedmero klinaca udruĹľi se kako bi pronaĹˇli krivca, no ubrzo saznaju kako nije rijeÄŤ o obiÄŤnom ÄŤovjeku. Ubojica je nitko drugi nego zli klaun Pennywise koji je zapravo ÄŤudoviĹˇte koje moĹľe poprimiti oblik onoga ÄŤega se njegov plijen najviĹˇe boji. Sada Ä‡e naĹˇa skupina, koja se nazvala â€śLosers Clubâ€ť, morati nauÄŤiti kako se boriti protiv svojih najveÄ‡ih strahova i rijeĹˇiti se ÄŤudoviĹˇta jednom zauvijek.', 3, '2017-09-07 00:00:00', './Content/images/It.jpg'),
(14, 'Baywatch', 'U ovom dugometražnom remakeu popularne TV serije iz 90-ih, legendarni kalifornijski spasitelj Mitch Buchannon (Dwayne Johnson) frustriran je zbog pojave novog, mlađeg, bahatog spasitelja Matta Brodyja (Zac Efron), koji je čak i osvojio olimpijsku medlaju u plivanju. No, ova dvojica muškaraca morat će naučiti kako surađivati kada nalete na veliku kriminalnu zavjeru koja uključuje operacije dilanja droge i koja prijeti uništenjem cijelog njihovog zaljeva, kao i ljudi do kojima im je najviše stalo u životu.', 5, '2017-06-01 00:00:00', './Content/images/Baywatch.jpg'),
(15, 'Hababam Sinifi', 'Lijeni, neobrazovani studenti dijele vrlo blisku vezu. Zajedno žive u spavaonici, gdje planiraju svoje najnovije spačke. Kada stigne novi ravnatelj, učenici ga prirodno pokušavaju svrgnuti. Slijedi komični rat.', 5, '1975-04-01 00:00:00', './Content/images/Hababam.jpg'),
(16, 'Kod Adi K.O.Z. ', 'Pogled na skandal s korupcijom u Turskoj od 17. do 25. prosinca 2013. s gledišta Erdoganove vlade.', 1, '2015-02-13 00:00:00', './Content/images/KOD.jpg'),
(17, 'Gigli', 'Larry Gigli odredi zločinačkog šefa da otme brata istaknutog okružnog tužitelja. Lijepa žena poznata samo kao Ricki poslana je da ostane s njim kako bi se osigurala da ne zabrlja posao.', 2, '2003-08-01 00:00:00', './Content/images/Gigli.jpg'),
(18, 'Casablanca', 'Tokom Drugog svjetskog rata u Casablanci, Rick Blaine, prognani Amerikanac i bivši borac za slobodu, vodi najpopularniji noćni klub u gradu. Cinični samotnjak Blaine dobiva dva veoma važna pisma koja treba proslijediti dalje. Kada njemački pukovnik Strasser dođe u Casablancu, kapetan policije Renault radi što god može kako bi mu udovolio, uključujući uhićenje čehoslovačkog vođe podzemlja Vidtora Laszloa. Na Rickovo iznenađenje, Lazslo dođe sa Ilsom, Rickovom bivšom ljubavi. Rick još uvijek gaji gorke osjećaje prema Ilsi, koja ga je ostavila u Parizu, no kada sazna njene razloge, njih dvoje odluče pobjeći iz Casablance.', 3, '1943-01-23 00:00:00', './Content/images/Casablanca.jpg'),
(19, 'The Notebook', 'Film se fokusira na starca koji čita priču staroj ženi u domu za nemoćne. Priča koju joj čita prati dvoje mladih ljubavnika Allie Hamilston i Noahu Calhouna, koji se upoznaju jedne večeri na karnevalu. No, Allieini roditelji ih razdvoje jer ne odobravaju Noahinu siromašnu obitelj, te presele Allie. Nakon što je godinama čekala da joj Noaha napiše pismo, Allie upozna i zaruči se za naočitog mladog vojnika Lona. Nakon toga, Allie, i dalje zaljubljena u Nou, ode do njegove kuće kako bi vidjela je li s njim sve u redu. U tom trenutku postaje jasno da njih dvoje i dalje gaje osjećaje jedno prema drugome, a Allie sada mora odabrati između dva muškarca u svom životu.', 5, '2004-06-25 00:00:00', './Content/images/TheNotebook.jpg'),
(20, 'P.S. I Love You', 'Holly Kennedy je lijepa, pametna i udana za ljubav svog života – strastvenog, smiješnog i zgodnog Irca zvanog Gerry. No kada Gerry premine zbog teške bolesti, ona ostane potpuno beživotna. Jedina osoba koja joj može pomoći više nije sa njom. Nitko ju ne poznaje bolje od njega. Stoga je dobro da je on planirao unaprijed. Prije nego što je umro, Gerry je Holly ostavio seriju pisama koja će ju voditi kroz njeno putovanje puno tuge, no i otkrivanja novih prijateljstava, kao i same sebe.', 2, '2008-02-14 00:00:00', './Content/images/ILY.jpg'),
(21, 'Anna', 'Ispod zapanjujuće ljepote top modela, Anne Poliatove, skriva se njezina nevjerojatna snaga i vještine koje je čine jednom od najstrašnijih ubojica vlade. Uzbudljiva, energična vožnja s neočekivanim preokretima i akcijom koja oduzima dah, uvodi nas u radnju ove priče.', 3, '2019-06-20 00:00:00', './Content/images/Anna.jpg'),
(22, '300', '480. g. pr. K. perzijski kralj Xerxes šalje svoju masivnu vojsku kako bi osvojili Grčku. Grčki grad Sparta posjeduje najbolje ratnike, a 300 od njih odabrano je za bitku protiv Perzijanaca kod Termopila, gdje će se sukobiti u uskom klancu kako Perzijanci ne bi mogli iskoristiti svoju brojčanu nadmoć u potpunosti. Bitka je samoubilačka misija, kojoj je svrha kupovanje vremena kako bi se ostatak Grka pripremio za invaziju. No, to ne sprečava Spartance da uđu u nju svim srcem, odlučni da sa sobom u grob odvedu što više Perzijanaca mogu.', 2, '2006-12-09 00:00:00', './Content/images/300.jpg'),
(23, 'Batman Begins', 'Nakon što mu roditelji budu ubijeni, milijarder Bruce Wayne preseli se u Aziju gdje ga mentori Henri Ducard i Ra’s Al Ghul uče kako se boriti protiv zla. Kada sazna da Ducard planira izbrisati svo zlo iz Gotham Cityja, Bruce zaustavlja plan i vraća se kući u Gotham. Tamo polako poprima svoj novi identitet borca protiv kriminalaca i korupcije i postaje Batman. No, stvari neće dugo biti mirne…', 4, '2006-06-13 00:00:00', './Content/images/Batman.jpg'),
(24, 'Dunkirk', 'Ovaj novi film genijalnog redatelja Christophera Nolana prikazuje dramatičnu i istinitu priču o evakuacijama u Dunkirku, plaže i luke na kojoj se odvila jedna od najopakijih borbi tokom Drugog svjetskog rata. Nakon naizgled bezizbježne situacije u kojoj su se našli saveznički vojnici, opkoljeni njemačkim silama sa svih strana, oni neočekivano dobivaju pomoć i priliku za evakuaciju, dok stravična borba i dalje ne popušta.', 3, '2017-07-20 00:00:00', './Content/images/Dunkirk.jpg'),
(25, '21 Bridges', 'Nakon njujorške pljačke banke koja je krenula u krivom smjeru i iza sebe ostavila čak osam mrtvih policajaca NYPD-a, poduzimaju se ekstremne mjere kako bi se ubojicama spriječilo da pobjegnu s Manhattana, budući da vlasti zatvaraju svih 21 mostova kako bi spriječile bilo kakav ulazak ili izlazak s otoka. Kako se noć razvija, linije postaju nejasne o tome koga zapravo slijede a neočekivana zavjera se polako otkriva…', 2, '2020-02-27 00:00:00', './Content/images/21B.jpg'),
(26, 'Cartel Land', 'Dr. Jose Mireles, ljiečnik iz maloga grada, predovdi skupinu zvanu Autodefensas, koja diže pobunu protiv nasilnog kartela koji već godinama radi kaos u njihovom području. U međuvremenu, u Arizoni, u uskom koridoru poznatom kao „Aleja kokaina“, američki veteran Tim Foley predvodi malenu paramilitarnu skupinu kojoj je cilj spriječiti vođenje ratova meksičkih kartela na američkoj strani granice. Ovaj film priča je o ovoj dvojici muškaraca koji pokušavaju preuzeti pravdu u svoje ruke tamo gdje su vlasti zakazale.', 4, '2015-01-23 00:00:00', './Content/images/Cartel.jpg'),
(27, 'Aquaman', 'Priča o mladom Arthur Curryhy koji doznaje da je nasljednik trona podvodnog kraljevstva Atlantide u koje se mora vratiti i spasiti svoj narod. Uz Jasona Momou u ulozi kralja mora, u filmu se pojavljuje još veliki broj fantastičnih glumaca – Ocean Mastera glumi Patrick Wilson, Amber Heard glumi kraljicu mora Meru, a Willem Dafoe je Aquamanov saveznik, Vulko.', 3, '2018-12-13 00:00:00', './Content/images/Aquaman.jpg'),
(28, 'Big Game', 'Kada predsjednikov avion biva srušen, a predsjednik SAD-a ostane prepušten divljini, postoji samo jedna osoba koja ga može spasiti – 13-godišnji dječak zvan Oskari. On je u šumi kako bi ulovio jelena, čime će dokazati svoju muškost. No, kada teroristi krenu u potragu za predsjednikom, ovaj duo se mora udružiti kako bi pobjegli od njih. Dok ljudi iz Pentagona promatraju situaciju preko satelita, predsjednik i njegov novi prijatelj moraju se dokazati i preživjeti ovih najnevjerojatnijih 24 sati svog života.', 2, '2015-04-16 00:00:00', './Content/images/BigGame.jpg'),
(29, 'Keanu', 'Clarence i Rell su rođaci koji žive u gradu, no nemaju ni mrvicu ulične snalažljivosti. Kada Rellu otmu njegovog voljenog mačka Keanua, ovaj nevjerojatno poštenjački par mora impersonirati okrutne ubojice kako bi se mogli infiltrirati u uličnu bandu i pronaći otetog mačka. No, izuzetno slatki mačak postane toliko omiljen i prestižan, da zbog njega ubrzo dođe do rata bandi, što prisili naše junake da preuzmu zakon u svoje vlastite ruke.', 3, '2016-04-29 00:00:00', './Content/images/Keanu.jpg'),
(30, 'Sicario', 'U bezakonjem pograničnom području između SAD-a i Meksika, idealistična FBI agentica Kate dobiva zadatak od voditelja elitne postrojbe da postane članica tima koji se bori protiv droge. Prevođen enigmatičnim savjetnikom veoma sumnjive prošlosti, njen tim kreće na putovanje koje će Kate natjerati da preispita sve u što je do sada vjerovala kako bi preživjela.', 4, '2015-10-02 00:00:00', './Content/images/Sicario.jpg'),
(31, 'A Bug''s Life', 'Jednom u godini dana, nekoliko skakavaca dođe na mravinjak i pojedu ono što su mravi napravili. No, jedne godine, buba Filk slučajno baci hranu u rijeku. Ljutiti, skakavci daju mravima posljednju šansu da nađu hranu do iduće sezone. Filk krene tražiti pomoć te upozna cirkusku ekipu, što mravima pruži nadu.', 4, '1998-11-25 00:00:00', './Content/images/ABL.jpg'),
(32, 'Coco', 'Iako u njegovoj obitelji postoji generacijama stara zabrana sviranja glazbe, Miguel sanja o tome da postane uspješni glazbenik kao što je to i njegov idol, Ernesto de la Cruz. Očajan da svima pokaže svoj talent, Miguel se ubrzo nađe u nevjerojatnoj i čarobnoj Zemlji mrtvih nakon misterioznog slijeda događaja. Putem, on će upoznati šarmantnog prevaranta Hectora, a oni će zajedno morati krenuti na nevjerojatno životno putovanje tokom kojeg će pokušati pronaći pravu istinu koja se skriva iza Miguelove obitelji i njene povijesti.', 3, '2017-11-23 00:00:00', './Content/images/Coco.jpg'),
(33, 'Inside Out', 'Odrastanje može biti prilično teško – a to nije iznimka niti za Riley, koja se seli iz mirnog grada u San Francisco kada njen otac tamo dobiva novi posao. Kao i svi mi, i Riley je pod velikim utjecajima svojih emocija – Sreće, Straha, Ljutnje, Gađenja i Tuge. Njene emocije žive u Sjedištu, kontrolnom centru u Rileyinom mozgu, gdje joj pomažu prebroditi svakodnevicu. No, kako se Riley i njene emocije trude priviknuti na novi život u San Franciscu, u Sjedištu dolazi do opće panike. Iako Sreća, Rileyjina najvažnija emocija, pokušava stvari održati pozitivnima, ostale emocije počnu se svađati oko toga kako se najbolje priviknuti na novu situaciju.', 5, '2015-06-18 00:00:00', './Content/images/InsideOut.jpg'),
(34, 'How to Train Your Dragon: The Hidden World', 'Priča o velikom prijateljstvu između adolescentskog Vikinga i strašnog zmaja Noćni bijes koj se razvilo u epsku avanturu koja se proteže u njihovim životima. Vladar Berka uz Astrid, Štucko je stvorio veličanstvenu kaotičnu utopiju zmajeva. Kada se Štucko i Bezubica iznenada susreću sa ženskom vrstom noćnog bijesa, moraju napustiti jedinstveni dom kojeg su poznavali i otputovati u skriveni svijet za koji većina vikinga vjeruje da je samo mit. Kako se otkriju njihove prave sudbine, zmaj i jahač će se boriti zajedno na samom kraju Zemlje kako bi zaštitili sve do čega im je ikad u životu stalo.', 3, '2019-01-31 00:00:00', './Content/images/Dragon.jpg'),
(35, 'Arctic Dogs', 'U novom akcijskom animiranom filmu redatelja filma Spark, arktička lisica+ radi u poštanskoj službi, ali sanja o tome da jednog dana postane Top Dog – arktički haski dostavljač. Kako bi dokazao da je vrijedan uloge, tajno dogovori isporuku paketa na tajanstvenu lokaciju. Na putu prema tamo naleti na nepoznatu tvrđavu u kojoj se suočava sa zlobnim genijem koji ima mehaničke noge i naređuje lojalnoj vojsci…', 2, '2020-01-03 00:00:00', './Content/images/ArcticDogs.jpg'),
(36, 'Bling', 'Niskorangirajući mehaničar u parku Sam sanja o svojoj prvoj ljubavi Sue. Zbog krive percepcije da će samo pomoću raskošnog prstena uspjeti osvojiti njeno srce, Sam isplanira najsavršeniju moguću noć u kojoj će zaprositi svoju jednu jedinu, istinsku ljubav. No, kada se pojavi superzlikavac Oscar koji je osmislio opaki plan uz pomoć svog vlastitog prstena, Samovi planovi naglo padaju u vodu. Nakon što ova dvojica zabunom zamjene svoje prstene, Sam će se morati udružiti sa svojim robotskim superjunacima kako bi pronašao svoj zaručnički prsten i spasio grad, a putem će i saznati kako nije bitna veličina dijamanta, već veličina srca.', 5, '2017-01-19 00:00:00', './Content/images/Bling.jpg'),
(37, 'Life, Animated', 'Owen Suskind bio je dječak koji je pokazivao veliki potencijal, sve dok sa 3 godine nije obolio od autizma. Kako se počeo povlačiti u sebe, njegovi roditelji polako su počeli gubiti nadu da će ikada više moći značajno komunicirati sa svijetom oko sebe. No, ipak su uspjeli pronaći način – kroz animirane filmove, posebice one Walta Disneyja, koji su Owenu pružili mogućnost da poima svijet kroz njihove priče, te su doveli i do toga da i on sam kreira svoje. Ovaj film govori o Owenovom životu i njegovom putu da postane funkcionalna osoba u društvu uz pomoć Disneyjevih animiranih filmova. No, Owen ubrzo saznaje da je pravi život mnogo više od onoga što je Walt Disney ispričao u svojim filmovima.', 4, '2017-04-15 00:00:00', './Content/images/LifeAnimated.jpg'),
(38, 'Loving Vincent', 'Godinu dana nakon smrti Vincenta van Gogha, poštar Roulin nagovori svog sina Armand da dostavi umjetnikovo posljednje pismo, svojem sada već pokojnom bratu Theu, nekome tko ga želi preuzeti. Armand nevoljko odlazi, te ubrzo pronađe bliskog prijatelja Vincenta, Dr. Gachet. Čekajući da se doktor vrati s posla, Armand upoznaje sve više ljudi koji su Vincenta ne samo poznavali, već je on imao i veliki utjecaj na njih, kao i oni na njegova umjetnička djela. No, kopajući dublje, Armand počinje shvaćati da je Vincentov neobičan život podložan interpretaciji jednako kao i njegova umjetnička djela.', 3, '2018-12-28 00:00:00', './Content/images/LovingVincent.jpg'),
(39, 'Peter Pan: The Quest for the Never Book', 'Čarobna zemlja Nizozemska je u velikoj opasnosti jer je Kapetan Kuka odlučio osloboditi čudovišta kako bi jednom zauvijek uništio Petar Pana. Da li će Petar uz pomoć svojih prijatelja uspjeti ispuniti proročanstvo Magične knjige Nizozemske i da li će vjerni prijatelji uspjeti spasiti Nizozemsku i London?', 4, '2018-12-27 00:00:00', './Content/images/PeterPan.jpg'),
(40, 'Rise of the Guardians', 'Kada zli duh zvani Pitch Black, a poznatiji djeci kao Baba Roga, započne svoj napad, Zaštitinici – Djed Božićnjak, Zubić vila, Uskršnji zeko i Sandman – moraju pozvati novog Zaštitnika da im priskoči u pomoć. To je Jack Frost, no on ne želi niti čuti o suradnji s njim. Dok se Zaštitnici bore protiv Pitch Blacka i pokušavaju uvjeriti Jacka da im se pridruži, djeca polako prestaju vjerovati u njih, što im oduzme njihove moći. Jack sada mora pomoći Zaštitnicima da vrate svoje moći uz pomoć djece Zemlje kako bi mogli nastaviti čuvati djecu od opasnosti.', 3, '2012-11-29 00:00:00', './Content/images/Rise.jpg'),
(41, 'Abigail', 'Mlada djevojka imena Abigail živi u gradu koji pretvoren u karantenu nakon što su njegove granice zbog epidemije misteriozne bolesti već godinama zatvorene. Njen otac bio je jedan od zaraženih i odveden je kada je ona imala samo šest godina. U borbi s moćnicima, kako bi pronašla svog oca, Abigail doznaje da je njen grad pun magije i u sebi otkriva izvanredne sposobnosti…', 2, '2019-12-12 00:00:00', './Content/images/Abigail.jpg'),
(42, 'Black Sea', 'Ovaj napeti triler fokusira se na odmaznog kapetana podmornice koji sakupi ekipu odmetnika kako bi krenuli u lov na potopljeno blago za koje se smatra da je izgubljeno u dubinama Crnog mora. Dok posadu klasustrofobične podmornice počne opsjedati pohlepa i očaj, sve sveća nesigurnost u misiju uzrokuje međusobne izdaje među članovima posade, koji se sada bore svatko za sebe.', 4, '2014-12-05 00:00:00', './Content/images/BlackSea.jpg'),
(43, 'Excalibur', 'Uthur Pendragon dobiva mistični mač Excalibur od čarobnjaka Merlina. Na svojoj samrti, Uthur zakopa mač u kamen, a idući čovjek koji ga uspije izvući postat će novi engleski kralj. Mnogo godina kasnije, Arthur, Uthurov nezakonit sin uspije izvući Excalibur i postane kralj. Pod okriljem Merlina, on se ženi za Guenivere i okuplja vitezove Okruglog stola. No, Arthurova zla polusestra Morgana s njim začme dijete, koje bi moglo označiti Arthurovu propast.', 4, '1981-04-10 00:00:00', './Content/images/Excalibur.jpg'),
(44, 'All is Lost', 'Čovjek plovi sam na svojoj jahti, no tokom noći njegov brod sudari se sa kontejnerom koji pluta po moru dok on spava. Jahta poplavi, te izgubi mogućnost navigacije i komunikacije, te kreće plutati prema oluji. Kada jahta potone, mornar se iskrca u splavi i krene plutati do trgovačkih mora. Sada počinje njegova borba za opstanak.', 3, '2013-10-25 00:00:00', './Content/images/AllIsLost.jpg'),
(45, 'Midnight Special', 'Jedan otac kreće u bijeg kako bi zaštitio svog sina Altona, te otkrio istinu koja se krije iza dječakovih specijalnih moći. Ono što počne kao bijeg od religioznih ekstremista i lokalne policije, brzo se pretvori u nacionalni lov koji uključuje najviše nivoe federalne vlade. Naposlijetku, otac će morati riskirati sve što ima kako bi zaštitio Altona i pomogao ispuniti proročanstvo koje bi moglo zauvijek promijeniti svijet.', 2, '2016-04-21 00:00:00', './Content/images/MidnightSpecial.jpg'),
(46, 'Pompeii', 'Smješten u 79. godini nove ere, ovaj film priča epsku priču o Milou (Kit Harrington), robu koji je postao nepobjedivi gladijator koji se nađe u utrci protiv vremena kako bi spasio svoju pravu ljubav Cassiu (Emily Browning), prelijepu kći bogatog trgovca koja je protiv svoje volje obećana korumpiranom rimskom senatoru. Kada vulkan Vezuv eruptira i lava počne letjeti na sve strane, Milo mora pronaći izlaz iz arene kako bi spasio svoju voljenu, dok nekoć slavni Pompeji propadaju oko njega.', 2, '2014-02-21 00:00:00', './Content/images/Pompeii.jpg'),
(47, 'Jurassic Park', 'Na izoliranom otoku, bogati filantrop potajice je napravio zabavni park za živim dinosaurima uz pomoć prethistorijskog DNK. Prije nego otvori park za publiku, on poziva vrhunskog paleontologa, paleobotanisticu, matematičara, te svog unuka i unuku kako bi doživjeli park i pomogli smiriti živce ulagača. No, njihov posjet je sve samo ne miran kada sustav za sigurnost padne, a dinosauri izađu izvan svojih granica.', 4, '1993-09-30 00:00:00', './Content/images/JurassicPark.jpg'),
(48, 'Battleship', 'Temeljen na klasičnoj Hasbro društvenoj igri potapanja brodova, „Battleship“ je priča o internacionalnoj floti brodova koji naiđu na vanzemaljsku armadu za vrijeme manevarskih vježbi. Žestoka borba vodit će se na moru, kopnu i u zraku. No, što zapravo vanzemaljci žele?', 3, '2012-05-18 00:00:00', './Content/images/Battleship.jpg'),
(49, 'Anka', 'Bajka smještena u srednjoj Europi početkom prošloga stoljeća, ANKA je priča o djevojčici iz sirotišta koju posvaja bogata rođakinja. Nedugo nakon Ankina dolaska otmjena rođakinja pokazuje drugo lice te razočarana i utučena Anka bježi, želeći se vratiti u sirotište. Put je dovodi do ciglane okružene visokim stablima i neobičnom prirodom. Grubih lica i velikoga srca, ciglari joj daju novi privremeni dom, daju joj sobu buntovnoga ciglara Brazilijanca, siročeta poput nje, koji je završio tu noć u zatvoru zbog kavge koju je započeo u seoskoj krčmi. U ciglani u dubini šume, s ovozemaljskim životom isprepliće se začudni, bajkoviti, svijet šumskih bića, koja vide samo djeca bujne mašte…', 4, '2017-02-23 00:00:00', './Content/images/Anka.jpg'),
(50, 'Shazam!', 'Drevni čarobnjak je 14-godišnjaku dao moć da se po potrebi transformira u odraslog muškarca s nadljudskim moćima. Još uvijek dječak u duši, Shazam otkriva svoju odraslu verziju čineći ono što bi svaki tinejdžer učinio sa supermoćima – zabavlja se s njim! Shazam isprobava granice svojih moći, ali morat će brzo ovladati njima kako bi se borio protiv smrtonosnih sila zla koje kontrolira dr. Thaddeus Sivana.', 4, '2019-04-04 00:00:00', './Content/images/Shazam.jpg'),
(51, '4 ruže', 'Film prikazuje urbani mozaik gradskih likova, koje u ispovijesti jedne beogradske noći, povezuje želja za brzom i lakom lovom, dobrim provodom i bezbrižnim jutrom. Iza kulisa carstva poroka u noćnom klubu Četiri ruže, u kojem se vodi bespoštedna borba, često i sa one strane zakona, naći će se jedan običan čovjek koji će, u bezuspešnom pokušaju da od svega pobjegne, shvatiti da će to uspjeti samo ako u pomoć pozove sve ono što je u međuvremenu izgubio: ljubav, iskrenost i vjeru…', 3, '2020-02-27 00:00:00', './Content/images/4ruze.jpg'),
(52, 'A Private War', 'Film je temeljen na članku Marie Brenner iz 2012. godine koji je bio objavljen u Vanity Fairu, a prati mukotrpno izvještavanje iz raznih ratnih zona na koja je neustrašiva Colvin odlazila. Izvještavala je sa svakog velikog sukoba u svijetu od Čečenije do Šri Lanke u gdje je izgubila lijevo oko 2001. godine. Njezina misija je bila pokazati pravi trošak rata, zajedno s poznatim ratnim fotografom Paulom Conroyem. Ubijena je 2012. godine u Siriji tijekom jednog napada, dok je izvještavala za britanski The Sunday Times, zajedno s fotografom s kojim je putovala.', 3, '2019-01-10 00:00:00', './Content/images/APrivateWar.jpg'),
(53, 'Churchill', 'Lipanj 1944. Saveznici se pripremaju na jugu Britanije, kako bi napali Europu koja se nalazi pod okupacijom Nacista. Jedan čovjek stoji im na putu – Winston Churchill. On je u strahu da ne ponovi masovni pokolj iz 1915, kada je preko 500,000 vojnika stradalo na plaži Gallipoli. Umoran od godina rata i pod utjecajem depresije, Churchill je sjena čovjeka koji se odupirao Hitlerovom blitzkriegu. Ukoliko plan za Dan D propadne, on je užasnut da će ga se svijet sjećati kao arhitekta pokolja. Samo uz podršku svoje vjerne žene Clementine, Churchill će uspjeti prebroditi svoje mentalne probleme i napraviti jedan od najvećih vojnih pothvata u povijesti čovječanstva.', 5, '2017-06-15 00:00:00', './Content/images/Churchill.jpg'),
(54, 'Anomalisa', 'Michael Stone, autor koji specijalizira u korisničkoj podršci, također je i čovjek koji se ne može duboko povezati sa drugim ljudima. Njegova niska osjetljivost prema uzbuđenju i njegov manjak intersa učinili su ga čovjekom koji živi prilično repetitivan život. No, kada ode na novi poslovni put, on upozna novu nevjerojatnu osobu koja će postati lijek za njegovu negativnost i vrlo vjerojatno promijeniti njegov dosadan život.', 2, '2015-03-11 00:00:00', './Content/images/Anomalisa.jpg'),
(55, 'Greta', 'Naivna mlada žena Frances koja pokušava preživjeti i uspjeti sama u New Yorku vrati pronađenu torbicu u podzemnoj željeznici zakonitom vlasniku. Vlasnica te torbice je Greta, vrlo usamljena i ekscentrična francuska učiteljica klavira. Nakon što je nedavno izgubila majku, Frances se ubrzo zbliži s Gretom i njih dvije postaju prijateljice, no uskoro Frances otkriva da ništa u Gretinom životu nije onako kako se čini…', 3, '2019-05-02 00:00:00', './Content/images/Greta.jpg'),
(56, 'Every Day', 'Temeljen na uspješnom New York Times bestselleru autora Davida Levithana, “Every Day” priča je o Rhiannon (Angourie Rice), sramežljivoj 16-godišnjakinji koja se zaljubi u misterioznu dušu zvanu “A”, koji svaki dan poprima neko drugo tijelo. Nalazeći se u veoma čudnoj vezi, Rhiannon i “A” trude se svaki dan pronaći, ne znajući koga ili što će im novi dan donijeti. Što više se zaljubljuju jedno u drugo, to više istovremeno i pate, što će naposlijetku Rhiannon dovesti do toga da donese najtežu odluku svog života.', 3, '2018-05-03 00:00:00', './Content/images/EveryDay.jpg'),
(57, 'Immortals', 'U Grčkoj, okrutni i zli kralj Hyperion sa svojom vojskom traži luk Epirus, moćno oružje skovano od bogova, kako bi oslobodio zarobljene Titane i uništio bogove. Kada Hyperion dođe do sela u kojem živi Theseus, on ubije njegovu majku i njega povede sa sobom kao roba koji će raditi u rudniku. No, Phaedra mu pomogne pobjeći uz pomoć zatvorenika Stavrosa. U međuvremenu Zeus savjetuje ostalim bogovima da se ne bi trebali u ljudsku slobodu izbora jer je ona njihova posljednja šansa za spas.', 2, '2011-11-10 00:00:00', './Content/images/Immortals.jpg'),
(58, 'Yesterday', 'Ne baš uspješan glazbenik, nakon bizarne noći kada je cijeli svijet na kratko ostao bez električne energije je jedini čovjek na svijetu koji se sjeća grupe The Beatles i njihovih pjesama. Kako se nitko ne sjeća da su Beatlesi ikad postojali, on se potpisuje kao autor svih njihovih pjesma i postaje zvijezda svih zvijezda.', 4, '2019-06-27 00:00:00', './Content/images/Yesterday.jpg'),
(59, '47 Ronin', 'Nakon što izdajnički vojskovođa ubije njihovog majstora i protjera njihovu vrstu, 47 samuraja bez vođe sada traže osvetu i povrat svoje časti među narodom. Protjerani iz svojih domova i raspršeni po cijeloj zemlji, ova skupina Ronina morat će potražiti pomoć Kaia – pripadnika nečiste vrste kojeg su nekoć prezirali – kako bi uz njegovu pomoć mogli proći kroz divlji svijet mitskih bića, vještica i ostalih terora. I dok ovaj protjerani, zarobljeni odbačenik postaje njihovo najubojitije oružje, on će se polako transformirati u junaka koji će služiti kao inspiracija svojoj grupi, te ih dovesti do konačne pobjede.', 2, '2013-12-26 00:00:00', './Content/images/47.jpg'),
(60, 'The Shape of Water', 'Od majstora fantastičnih priča, Guillerma del Toroa, dolazi nam novi film, “The Shape of Water”, čudesna bajka smještena u doba hladnog rata u Americi tokom 1962. godine. U strogo čuvanom i tajnom laboratoriju vlade, kao čistačia radi usamljena Elisa (Sally Hawkins) – ona je ovdje zarobljena u životu u potupnoj izolaciji od ostatka svijeta. No, njen život zauvijek će se promjeniti kada ona i njena kolegica Zelda (Octavia Spencer) pronađu tajni eksperiment – podmorno stvorenje s kojim će ostvariti uistinu neobičnu, ali veoma snažnu povezanost.', 5, '2018-02-01 00:00:00', './Content/images/Water.jpg'),
(61, 'Child''s Play', 'Remake istoimenog filma iz 1988. godine. Svijet mladog dječaka i njegove majke se okrenuo naglavačke kada nova dječja lutka odjednom uzme mračan okret od bezopasne igračke do sadističkog ubojice zajedno s nasilnim sklonostima.', 2, '2019-07-25 00:00:00', './Content/images/ChildsPlay.jpg'),
(62, 'Ghostland', 'Pauline (Mylene Farmer) naslijedi kuću od svoje tete, no kada se ona u nju useli, već prvu noć doživi groznu konfrontaciju sa ubojicama koji joj upadnu u kuću, te se mora boriti kako bi spasila živote svojih dviju kćeri, Beth (Crystal Reed) i Vere (Anastasia Philips). 16 godina kasnije, Beth, koja je sada autorica horor priča, i Vera, ponovno se ujedinjuju u ovoj kući, no tada se oko njih počnu odvijati veoma čudne i sablasne stvari.', 3, '2018-04-19 00:00:00', './Content/images/Ghostland.jpg'),
(63, 'Victor Frankenstein', 'Radikalni znanstvenik Victor Frankenstein i njegov jednako briljantni suradnik Igor Strausman zajedno dijele viziju pomaganja čovječanstvu putem njihovog revolucionarnog istraživanja o besmrtnosti. No, Victorovi eksperimenti prijeđu granicu prihvatljivog, a njegova opsesija sa sobom će povući stravične posljedice. Sada je Igor jedini koji može vratiti svog prijatelja iz ponora ludosti i spasiti ga od njegove mionstruozne kreacije.', 3, '2016-02-18 00:00:00', './Content/images/Victor.jpg'),
(64, 'Overlord', 'U kasne večernje sate, na Dan D, skupina vojnika poslana je u nacistički okupiranu Francusku kako bi dovršili svoju zadnju ratnu misiju. Na terenu otkrivaju nacistički laboratorij koji izvodi lude pokuse na lokalnom stanovništvu. Vojni trening ih nije pripremio za ono što će uslijediti, a to je spašavanje svijeta od još veće prijetnje te borba s postrojbom genetski poboljšanih Super vojnika!', 3, '2018-11-08 00:00:00', './Content/images/Overlord.jpg'),
(65, 'Countdown', 'Mlada medicinska sestra, Talithu Bateman, iz čiste zabave na svoj mobilni telefon instalira aplikaciju koja točno predviđa dan kad će osoba umrijeti. Mobilna aplikacija joj tada pokaže da ima samo tri dana života. Vrijeme je počelo otkucavati i Talithu počinje progoniti tajanstvena figura, pa mora pronaći način da spasi vlastiti život prije nego što joj ponestane to malo vremena koje joj je preostalo…', 2, '2019-10-24 00:00:00', './Content/images/Countdown.jpg'),
(66, 'Best Man Down', 'Kada njihov nepodnošljivi kum Lumpy (Tyler Labine) neočeikvano premine na njihovoj svadbi, mladoženja i mladenka Kristin (Jess Weixler) i Scott (Justin Long) prisiljeni su otkazati svoj medeni mjesec te odletjeti kući kako bi organizirali njegov sprovod. No, odvođenje Lumpyjevog tijela natrag je samo početak njihove avanture, jer njihova požrtvovna odluka iza svakog ugla skriva iznenađenja. A kada ih put dovee do petnaestogodišnjakinje (Addison Timlin) u malenom, sjevernom gradiću u Minnesoti – niti oni sami više neće biti sigurni tko je zapravo Lumpy bio', 3, '2013-10-03 00:00:00', './Content/images/Best.jpg'),
(67, 'Destination Wedding', 'Reeves i Ryder glume Franka i Lindsay, goste koji su pozvani na vjenčanje. Njima je zajedničko to što ne vole ništa živo, sve im smeta i ne podnose društvo drugih ljudi. Upravo će ta zajednička netrpeljivost postati ono što će ih približiti jedno drugome.', 3, '2019-01-10 00:00:00', './Content/images/Wedding.jpg'),
(68, 'A Little Chaos', 'U ovoj romantičnoj drami talentirana dizajnerica vrtova Sabine, koja upravo dizajnira vrt u Veraillesu za kralja Luja XIV,  mora voditi borbu protiv klasnih razlika dok počinje cvjetati ljubav između nje i renomiranog dizajnera sa dvora kralja, Andrea Le Notrea.', 3, '2015-04-17 00:00:00', './Content/images/Chaos.jpg'),
(69, 'The Nice Guys', 'U Los Angelesu, tokom 1970-ih, privatni detektiv Holland March, kojeg stalno prati nesreća, te plaćenik Jackson Healy, moraju zajedno surađivati kako bi riješili slučaj nestale djevojčice i naizgled nepovezan slučaj smrti porno glumice. Tokom svoje istrage, ova dvojica slučajnih junaka otkriti će nevjerojatno šokantnu zavjeru koja se uzdiže sve do najviših moćnih krugova.', 4, '2016-05-19 00:00:00', '/Content/images/NiceGuys.jpg'),
(70, 'Cop Out', 'Veteran detektiv Jimmy Monroe (Bruce Willis) treba novac kako bi mogao platiti kćerino ubrzo vjenčanje, stoga odluči da je vrijeme da proda svoju Pafko baseball karticu iz 1952.g. No, prije nego ju uspije unovčiti, ona biva ukradena, te se Jimmy i njegov partner Paul (Tracy Morgan) suočavaju sa gangsterom koji je ovisan o sportskoj memorabiliji. Prvo, Jimmy i Paul moraju spasiti lijepu svjedokinju ubojstva koja ima ključ do bogatstva u stranim bankovnim računima.', 2, '2010-02-26 00:00:00', './Content/images/CopOut.jpg'),
(71, 'A Single Shot', 'Tragična smrt predivne mlade djevojke poslužit kao katalist sa napetu i atmosfersku igru mačke i miša između lovaca Johna Moona i okorjelih kriminalaca koji žele njegovu krv.', 1, '2013-08-20 00:00:00', './Content/images/SingleShot.jpg'),
(72, 'American Pastoral', 'Seymour “Swede” Levov (Ewan McGregor), nekoć legendarni srednjoškolski sportaš, sada je uspješan biznismen oženjen sa Dawn (Jennifer Connelly), bivšom kraljicom natjecanja u ljepoti. No, u njihovom životu polako se počinju dešavati promjene koje će im zauvijek promjeniti život. Kada njegova voljena kćer tinejdžerka, Merry (Dakota Fanning) nestane nakon što je optužena za počinjavanje nasilnog djela, Swede se posveti tome da ju pronađe i ponovno ujedini svoju obitelj. No, ono što će ubrzo otkriti potrest će ga do same srži, te prisiliti da zaviri ispod površine i suoči se sa kaosom koji oblikuje svijet oko njega.', 2, '2017-03-30 00:00:00', './Content/images/Pastoral.jpg'),
(73, 'Wild Card', 'Nick Wild je tjelohranitelj u Las Vegasu, te posjeduje smrtonosne profesionalne vještine i veliki problem sa kockanjem. Kada njegovog prijatelja pretuče sadistični kriminalac, Nick uzvraća udarac, no saznaje da je kriminalac zapravo sin moćnog mafijaša. Odjednom, Nick se nađe u kriminalnom podzemlju, lovljen od strane mafije i njihovih partnera. Ulozi su veliki, a šansa za pobjedu je samo jedna – igra se na sve ili ništa!', 2, '2015-02-14 00:00:00', './Content/images/WildCard.jpg'),
(74, 'The Wolf of Wall Street', 'U ranim 1990-ima, Jordan Belfort sa svojim partnerom Donnyjem Azoffom pokrenuo je mešetarsku firmu Stratford-Oakmont. Ona je ubrzo višestruko narasla, kao i njihov status na Wall Streetu. No, sa bogatstvom i slavom, počeli su rasti i problemi sa drogom, te laži. Njihove zabave i ludi provodi počinju privlačiti pozornost FBI-a, koji otkriva da njihovo poslovanje nije čisto. Belfort želi spremiti svoj novac u europsku banku kako bi izbjegao moguće probleme, no pod budnim okom FBI-a, samo je pitanje dana kada će njihovom luksuznom životu doći kraj.', 5, '2013-12-26 00:00:00', './Content/images/WallStreet.jpg'),
(75, 'Fire With Fire', 'Nakon što je svjedočio brutalnom ubojstvu vlasnika dućana i svog sina, vatrogasac Jeremy Coleman jedva je uspio pobjeći žive glave. Kada biva prisiljen svjedočiti protiv krim-bossa Hagana, on dobije zaštitu od strane američkih maršala. No, njegov novi identitet ubrzo biva raskrinkan, te Jeremy počne dobivati prijetnje, što ga prisili da poduzme neočekivane mjere kako bi sačuvao svoj život i spasio one koje najviše voli – svoje bližnje.', 2, '2012-12-05 00:00:00', './Content/images/Fire.jpg'),
(76, 'Finding Altamira', 'Godine 1879. španjolski arheolog Marcelino (Antonio Banderas) i njegova kćer Maria (Allegra Allen) otkrivaju naizgled nemoguće slike galopirajućeg bizona koje ukrašavaju zidove skrivene pećine. Pećina Altamira ubrzo zapanji cijeli svijet, privlačeći razne tipove ljudi koji žele vidjeti slike uživo. No, Marcelino ubrzo spoznaje da su prikazi u pećini stari barem 10,000 godina – više nego što bilo tko vjeruje da je moguće. Ova teorija zaprijeti raspadanjem Marie i Marcelina, te njihove obitelji, dok vanjski svijet polako prelazi iz faze divljenja u bijes i strah. Katolička crkva ovo vidi kao napad na biblijsku istinu, dok znanstvenici također niti sami ne mogu vjerovati da je ovo istina. Marijina bajka polako postaje sve mračnija, dok njenoj obitelji prijati raspad, a Marcelinovo otkriće biva zakinuto. Samo njihova međusobna ljubav moći će ih navesti na pravi put i iskupljenje, dok se Marcelino bori za to da cijeli svijet sazna čistu istinu.', 2, '2016-04-01 00:00:00', './Content/images/Altamira.jpg'),
(77, 'We Were Soldiers', 'Priča o jednoj od najgroznijih bitaka u Vijetnamu, onoj u dolini La Drang 1965. g. Kroz oči zapovjednika Hala Moorea vidjet ćemo kako su tekle pripreme i njegovo preuzimanje bataljona, kao i način na koji su Francuzi izgubili tu istu bitku nekoliko godina prije. Bitka je bila jedna od prvih većih sukoba vojske SAD-a i NVA, te su u njoj demonstrirane sve moći modernog helikoptera.', 4, '2002-03-01 00:00:00', './Content/images/Soldiers.jpg'),
(78, 'Queen Of The Desert', 'Temeljen na životu britanske avanturistice, istraživačice, kartografkinje i političke oficirke Gertrude Bell, ovaj film prepričava njena putovanja, ljubavi i gubitke u Bliskom istoku tokom ranog 20. stoljeća.', 3, '2016-04-21 00:00:00', './Content/images/Queen.jpg'),
(79, 'Schindler''s List', 'Poduzetnik Oskar Schindler dolazi u Krakov 1939.g. kako bi profitirao od Drugog svjetskog rata, koji upravo započinje. Nakon što se pridruži nacističkoj partiji, kako bi i politički mogao napredovati, on u svojoj tvornici počne zapošljavati židove zbog toga što su jeftina radna snaga. No, kada SS počne ubijati židove u getu Krakova, Schindler se pobrine za to da njegovi radnici budu zaštićeni kako bi njegova tvornica i dalje mogla funkcionirati. Kasnije, njegovi interesi u potpunosti prestaju biti financijski, te on počne simpatizirati sa svojim radnicima, kojima odluči pomoći pod svaku cijenu.', 5, '1994-02-04 00:00:00', './Content/images/Schindler.jpg'),
(80, 'Hacksaw Ridge', 'Istinita priča o Desmondu Dossu, savjesnom vojniku, koji je zbog svog sudjelovanja u Bitci za Okinawu dobio Medalju časti za svoju nevjerojatnu hrabrost i obzirnost prema drugim vojnicima. Ovaj film prikazuje njegovo odrastanje, odgoj, te kako su oni uobličili njegove poglede na svijet, posebice njegov pogled na vjeru i stav prema neubijanju. Vidimo njegove muke i prepreke koje je morao premostiti nakon što se prijavio za vojsku i pokušao postati doktor. A u konačnici, imamo prilku i vidjeti kakav je to pakao na zemlji zapravo bio Hacksaw Ridge.', 5, '2016-11-10 00:00:00', './Content/images/Hacksaw.jpg'),
(81, 'An Act of War', 'Boreći se sa insomniom i PTSP-om, ratni veteran radi noćne smjene na projektoru u lokalnom kinu. Dok se trudi priviknuti na miran civilni život, ubrzo se nađe zapleten u mreži zavođenja, ovisnosti i nasilja iz koje neće moći tako lako pobjeći.', 2, '2015-03-31 00:00:00', './Content/images/ActofWar.jpg'),
(82, 'Unbroken', 'Film prati život Louieja Zamperinija, olimpijca koji se dobrovoljno prijavio u vojsku tokom Drugog svjetskog rata, te je ubrzo nakon pada svog aviona bio zatočen od strane japanske mornarice. U zatvoreničkom kampu u Tokyu doživio je razne muke, no svojom hrabrošću i srčanošću Louis se uspješno opirao mučenju i inspirirao ostale ljude u kampu.', 4, '2015-01-08 00:00:00', './Content/images/Unbroken.jpg'),
(83, 'T-34', 'Uz veliku hrabrost, neustrašive borbe i neraskidivu ljubav, ruski vojnici uspjevaju pobjeći iz njemačkog ropstva u polurazorenom tenku T-34. Grupu ruskih vojnika, koje je predvodio voditelj tenka Nikolaj Ivuškin, zarobile su njemačke snage koje su marširale na Moskvu tijekom Drugog svjetskog rata. Da bi spasio svoje ljude i svoju zemlju, mladi poručnik Ivuškin pokreće odvažan plan za bijeg…', 3, '2019-04-25 00:00:00', './Content/images/T34.jpg'),
(84, 'Twice Born', 'Talijanski redatelj Sergio Castellitto režira ovu romantičnu dramu o majci čija se sjećanja na tragičnu romansu pomute tokom puta u Sarajevo sa svojim sinom. Godine 1984.g, nadomak zimskih olimpijskih igara, Gemma se našla u Bosni gdje se zaljubila u zgodnog američkog fotografa Diega. Njihove strasti gorile su velikim plamenom tokom kratkog vremena koje su proveli zajedno, no rat je doveo do raspada njihove ljubavi. Sada, kada Gemma ponovno dolazi u Sarajevo, ona će se morati suočiti sa svim sjećanjima koja gaji duboko u sebi, kako onim dobrim, tako i onim gorkim.', 4, '2012-11-08 00:00:00', './Content/images/Twice.jpg'),
(85, 'The Hurt Locker', 'Ovaj film je napeti prikaz elitnih vojnika koji imaju jedan od najopasnijih poslova na svijetu – deaktiviranje bombi u ratnim zonama. Kada novi pukovnik, James, preuzme visoko treniran tim za deaktiviranje bombi usred nasilnog konflikta, on iznenadi svoja dva podređena, Sanborna i Eldridgea, nemarno ih bacajući u smrtonosnu igru urbane bitke. James se ponaša kao da mu smrt ništa ne znači. Dok se ljudi bore kako bi izkontrolira svog divljeg vodnika, grad pada u kaos, a Jamesovo razotkrivanje primjenit će obojicu likova zauvijek.', 4, '2009-07-31 00:00:00', './Content/images/Locker.jpg'),
(86, 'Already Tomorrow in Hong Kong', 'Ruby (Jamie Chung), kineska Amerikanka po prvi puta dolazi u Hong Kong zbog posla. Tamo upozna Josha (Bryan Greenberg), američkog iseljenika koji ju provede po gradu. Njih dvoje ubrzo se počnu zaljubljivati jedno u drugo, no taman kada se stvari počnu činiti dobrima, neočekivano otkriće dovodi do brzog prekida njihove romanse. Godinu dana kasnije, Josh i Ruby susretnu se u trajektu koji plovi od Hong Konga do Kowloona. Ruby je sada stalno zaposlena u Hong Kongu, a Josh je, djelomično zbog Rubyjinog savjeta od prije godinu dana, dao otkaz kako bi se mogao posvetiti pisanju. I on i ona sada imaju nekog drugog u svom životu, te odluče provesti jednu noć zajedno, kao prijatelji. No, kako noć odmiče kraju, oni sve teže uspijevaju sakriti svoje prave osjećaje jedno prema drugome.', 3, '2016-12-12 00:00:00', './Content/images/HK.jpg'),
(87, 'Easy A', 'Srednjoškolka Olive Penderghast (Emma Stone) nađe se u na meti tračeva svoje škola kada u laži ispriča svojoj najboljoj prijatelje Rhiannon (Alyson Michalka) o svom provodu preko vikenda sa starijim studentom. Tračevi o njenoj promiskuitetnosti se brzo prošire, a na njeno iznenađenje, njoj se svidi pažnja koju počne dobivati. Kada pristane pomoći prijatelju kojeg maltretiraju na način da se pretvara da je spavala s njim, njen imidž krene još naglije padati, a tračevi još brže širiti. Olive sada mora naći način kako da spasi svoj obraz, prije nego ju vjerska fanatičarka Marianne (Amanda Bynes) izbaci iz škole, te izgubi šansu za ostvarenje svoje sreće.', 4, '2010-11-25 00:00:00', './Content/images/EasyA.jpg'),
(88, 'Fifty Shades Darker', 'Zateknuta čudnim ukusima i mračnim tajnama zgodnog, ali izmučenog mladog poduzetnika Christiana Greya, Anastasia Steele prekinula je njihovu vezu kako bi započela novu karijeru u novoj novinskoj izdavačkoj tvrtki; no njena želja za Christianom i dalje dominira svakim trenutkom njenog života, a kada joj on predloži novu opciju, Anastasia jednostavno ne može odoljeti. Oni ponovno probude strast jedno u drugom, a Anastasia sazna mnogo više o prošlosti svog Christiana, uključujući i njegove prošle veze.', 3, '2017-02-09 00:00:00', './Content/images/FSD.jpg'),
(89, 'The Vow', 'Paige (Rachel McAdams) i Leo (Channing Tatum) su sretno vjenčani mladi par, no njihov idilični život ubrzo se raspadne kada Paige završi u komi nakon automobilske nesreće. Nakon što se probudi, ima gubitak pamćenja i više ne poznaje Lea. Također ima čudan odnos sa svojim roditeljima (Sam Neil, Jessica Lange) i još uvijek gaji osjećaje prema svom bivšem zaručniku (Scott Speedman). Unatoč ovim teškim okolnostima, Leo je odlučan obnoviti njihovu vezu i ispočetka sagraditi brak.', 4, '2012-02-10 00:00:00', './Content/images/Vow.jpg'),
(90, 'The Longest Ride', 'Luke je bivši šampion u borbi sa bikovima koji želi ponovno ostvariti uspjeh, a Sophia je studentica koja je upravo dobila svoj posao snova u umjetničkom svijetu New Yorka. Dok različiti putevi i ideali testiraju njihovu ljubavnu vezu, Sophia i Luke ostvare neočekivanu i iskrenu povezanost sa Irom, koji im ispriča priču o ljubavi njega i svoje žene, što pruži veliku inspiraciju Sophii i Lukeu. No, hoće li ustrajna ljubav i preskakanje svih prepreka uistinu donijeti dovoljno vrijednu nagradu?', 5, '2015-04-23 00:00:00', './Content/images/Ride.jpg'),
(91, 'A Cure for Wellness', 'Ambiciozni mladi voditelj odlazi po svog šefa koji se nalazi u idličnom, no istovremeno i misterioznom “wellness centru” koji se nalazi u izdvojenom dijelu švicarskih Alpi, no ubrzo počinje sumnjati da čarobni tretmani ovog centra i nisu sasvim obični. Kada počne otkrivati stravične tajne ovog centra, njegov zdrav um naći će se na velikoj kušnji, kada se naizgled razboli od iste čudne bolesti koja sve goste zadržava u ovom centru. Od redatelja Gorea Verbinskog (“The Ring”), dolazi nam ovaj novi sablasni triler, u kojem glavne uloge tumače Dane DeHaan i Jason Isaacs.', 3, '2017-02-16 00:00:00', './Content/images/Wellness.jpg'),
(92, 'Backcountry', 'Par iz grada odlazi na kampiranje u kanadsku divljinu. Alex je veteran u kampiranju, dok njegova djevojka Jenn, koja je odvjetnica, nema pojma što znači kampirati, no ipak, on ju uspije nagovoriti da krenu putem Blackfoota, Alexovom omiljenom destinacijom. No, kada se nakon nekog vremena izgube, oni počnu gubiti živce i zdrav razum, a njihova veza počne se na očigled raspadati. Tražeći izlaz iz šume, oni zalutaju na teritorij velikog medvjeda, što ih dovodi u životnu opasnost.', 3, '2015-08-28 00:00:00', './Content/images/Backcountry.jpg'),
(93, 'Air', 'U bliskoj budućnosti, zrak kojeg možemo udisati više ne postoji. Gotovo svi ljudi nestali su sa lica Zemlje, a oni koji su odabrani da nastave opstanak vrste nalaze se u suspendiranoj animaciji. Dva inženjera kojima je zadatak čuvati posljednje nade čovječanstva bore se sa održavanjem svog zdravog uma i svojih života dok pokušavaju što kvalitetnije obaviti svoj zadatak. No, stvari neće još dugo biti mirne.', 2, '2015-08-14 00:00:00', './Content/images/Air.jpg'),
(94, 'Cell', 'Za umjetnika Claytona Riddella, uhvatiti sreću u životu nikada nije bila laka stvar. Izmoren od podučavanja umjestnosti umjesto kreiranja iste, on napokon dobije svoju veliku priliku kada dobije posao u Bostonu. No, njegov život nepovratno će se promijeniti jedno jutro, kada se svi ljudi u istom trenutku jave na svoje mobitele. Misteriozni signal biva pušten kroz sve mobitele na svijetu, što pokrene smrtonosnu reakciju događaja. Korisnici mobitela postaju ultra-nasilni manijaci, koji napadaju sve što im se nađe u vidokrugu. Sve što Clay sada može jest udružiti se sa ostalim preživjelima i pripremiti se za novi život, bez društva, te samo sa pobješnjelim ljudima koji se pretvaraju u nešto mnogo gore.', 1, '2016-08-25 00:00:00', './Content/images/Cell.jpg'),
(95, 'Les Misérables ', 'Film inspiriran pariškim neredima 2005. godine i istoimenim kratkim filmom Ladj Ly-ja, Les Misérables predstavlja provokativan uvid u napetosti između stanovnika i policije. Stéphane se nedavno pridružio Odjelu za borbu protiv kriminala u predgrađu Pariza u kojem je Victor Hugo postavio radnju svoj poznatog romana “Les Miserables”. Ubrzo sa svojim novim kolegama otkriva porast napetosti između lokalnih bandi te se trojac nađe u nevolji tijekom jednog uhićenja, bespilotna letjelica snimi uhićenje, prijeteći da će razotkriti stvarnost svakodnevnog života.', 5, '2020-01-30 00:00:00', './Content/images/LM.jpg'),
(96, 'Jane Got a Gun', 'Jane Hammond napravila je novi život sa svojim mužem Billom Hammondom, nakon muke koju je preživjela sa ultra-nasilnom bandom zvanom „Bishop Boys.“ No, ona se još jednom nađe na meti ove okrutne bande kada njen muž dođe kući izrešetan nakon duela sa „Boysima“ i njihovim vođom Colinom. Sada u lovu od bande, Jane ne može pobjeći nigdje drugdje osim do svog bivšeg zaručnika Dana Frosta, kako bi joj pomogao obraniti njenu obitelj od sigurne smrti. Progonjena starim sjećanjima, Jane sada mora upoznati svoju prošlost sa svojom sadašnjošću u ovoj brutalnoj brobi za preživljavanje.', 2, '2016-01-29 00:00:00', './Content/images/Jane.jpg'),
(97, 'Echoes of War', 'U Teksasu netom nakon Američkog građanskog rata, dvije susjedne porodice žale za tragičnim gubicima svojih najmilijih, te pokušavaju opstati u ovoj ruralnoj drami koja ih je zadesila. Stočari McCluskey izgubili su i sina, kao i svu svoju stoku tokom rata. S druge strane, porodica Riley izgubili su ženu i majku Mary zbog bolesti, te sada preživljavaju prodavajući životinjsku kožu. Kada se šogor Seamusa Rileyja, Wade, vrati iz rata sa Konfederacijom, on ubrzo otkriva da Randolph McCluskey zajedno sa svojom obitelji krade životinje iz zamki koje je postavila njegova obitelj. On to smatra neoprostivim te odluči stvari uzeti u svoje ruke, što dovodi do još jednog besmislenog i tragičnog rata.', 2, '2016-11-24 00:00:00', './Content/images/Echoes.jpg'),
(98, 'Slow West', 'Na kraju 19. stoljeća, 16-godišnji Jay Cavendish putuje po američkoj divljini u potrazi za ženom koju voli. Njemu se na putovanju pridruži Silas, misteriozni putnik, a njih dvojicu cijelo vrijeme slijedi i skupina lovaca na glave, na čelu sa čovjekom zvanim Payne.', 3, '2015-05-21 00:00:00', './Content/images/West.jpg'),
(99, 'The Salvation', 'Moćni Mads Mikkelsen započinje krvavi uragan na Divljem zapadu u ovoj napetoj priči o osveti. Kada ubije ološ koji su ubili njegovu ženu i sina, bivši danski vojnik (Mikkelsen) na sebe navuče gnjev sadističnog lidera bande koji više od svega na svijetu želi njega vidjeti mrtvog. Izdan od strane svoje kukavičke zajednice, ovaj Danac morat će postati osvetnički lovac, pobiti sve odmetnike i pročistiti crno srce svog grada. Sa tonom akcije, veličanstvenim pejsažima i odličnim nastupom Eve Green, ovaj film je opaka, krvava saga o grijehu i iskupljenju.', 3, '2014-05-22 00:00:00', './Content/images/Salvation.jpg'),
(100, 'True Grit', 'Nakon ubojstva njenog oca od strane Toma Chaneya, 14-godišnja Mattie Ross kreće u osvetnički lov na ubojicu. Za pomoć, ona unajmi najopakijeg maršala kojeg može naći – Reubena J. „Roostera“ Cogburna. Mattie inzistira da prati Cogburna, čije pijančevanje, lijenosti i neljubaznost ne pridaju previše povjerenja u njegov ugled. Njima se pridruži i teksaški Ranger LaBoeuf, koji želi Chaneya iz svojih vlastitih razloga. Njih troje sada kreću na put pun opasnosti i avantura, u kojem će morati biti složni i tvrde kože.', 4, '2011-02-24 00:00:00', './Content/images/Grit.jpg'),
(101, NULL, NULL, 0, '0000-00-00 00:00:00', NULL);
